import { Card, Row, Col } from "react-bootstrap";
import companyLogo from "../../../../Asset/images/companylogo.png";
import { IoLocationSharp } from "react-icons/io5";
import { FaSuitcase } from "react-icons/fa";
import styles from "./style/style.module.css";
const Jobs = () => {
  return (
    <Card className={styles.rw}>
      <Row className={styles.company}>
        <Col>
          <img className={styles.img} src={companyLogo} alt="CompanyLogo" />
        </Col>
        <Col className={styles.name}>Amazon</Col>
      </Row>
      <Row className={styles.role}>iOS Developer</Row>
      <Row>
        <Col className={styles.col}>
          <Col>
            <IoLocationSharp />
          </Col>
          <Col>
            {/* <Row>Location</Row> */}
            <Row>Indore</Row>
          </Col>
        </Col>
        <Col className={styles.col}>
          <Col>
            <FaSuitcase />
          </Col>
          <Col>
            {/* <Row>Experience</Row> */}
            <Row>Upto 5 years</Row>
          </Col>
        </Col>
      </Row>
      <Row>Apply before 30th Nov</Row>
    </Card>
  );
};
export default Jobs;
